package io.renren.client.dto;/** * @Classname VerifyDto * @Pakage: io.renren.client.dto * @Author: hzr * @Description TODO * @Date 2024/3/22 14:30 * @Created by 22906 * @Version 1.0.0 */public class VerifyDTO {    private String token;    private String userId;    private String ofdId;    public String getToken() {        return token;    }    public void setToken(String data) {        this.token = data;    }    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public String getOfdId() {        return ofdId;    }    public void setOfdId(String ofdId) {        this.ofdId = ofdId;    }    @Override    public String toString() {        return "VerifyDTO{" +                "token='" + token + '\'' +                ", userId='" + userId + '\'' +                ", ofdId='" + ofdId + '\'' +                '}';    }}